    [],nt"num_tags": 4,nt"name": "chincoteague-refuge-narrative-report-september-1-to-december-31-1948",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Chincoteague
    NWR outlines Refuge accomplishments from September through December of 1948. The
    report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, mammals, and raptors- is also covered. The Refuge
    development and maintenance section discusses physical developments and collections
    and receipts. Resource management is outlined; topics include grazing. The public
    relations section of the report describes recreational uses, Refuge visitors, and
    violations. N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
